import React from 'react';
import Post from '../Post';
import '../App.scss';

const Blogs = () => {
  return (
    <>
      <div className='blogs'>Blogs</div>
      {posts.length > 0 && posts.map(post => (
        <Post {...post} />
      ))}
    </>
  )
}

export default Blogs
